

local function decrypt_xor(data, key)
    local result = {}
    for i = 1, #data do
        result[i] = string.char(string.byte(data, i) ~ key)
    end
    return table.concat(result)
end


local function mutate_string(s)
    local mutated = {}
    for i = 1, #s do
        mutated[i] = string.char(string.byte(s, i) ~ math.random(1, 255))
    end
    return table.concat(mutated)
end


